import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";import{o,c as t,a as i}from"./app.38166bb6.js";var a="/DBC-Wiki/assets/t5tbjk5h0sq81.f1dcd3db.webp";const r={},s=i('<h1 id="proposal-27-nexuicom-is-applying-for-a-gold-silver-nft" tabindex="-1"><a class="header-anchor" href="#proposal-27-nexuicom-is-applying-for-a-gold-silver-nft" aria-hidden="true">#</a> Proposal 27: NexuiCom is applying for a Gold/Silver NFT</h1><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>Reddit link: https://www.reddit.com/r/DBC_Council/comments/ttsm9i/proposal_27_nexuicom_is_applying_for_a_goldsilver/</p></div><p><img src="'+a+'" alt="Bringing the World of Tomorrow to the People of Today"></p><p><strong>\u63D0\u6848 27</strong> NexuiCom \u6B63\u5728\u7533\u8ACB\u91D1/\u9280 NFT</p><p>NexuiCom \u5728\u4E0B\u9762\u63D0\u4F9B\u4E2D\u6587\u7FFB\u8B6F\uFF0C\u5C07 DBC \u793E\u5340\u805A\u96C6\u5728\u4E00\u8D77\u3002</p><h2 id="english" tabindex="-1"><a class="header-anchor" href="#english" aria-hidden="true">#</a> English</h2><p>NexuiCom would like to put ourselves forward for the approval of a Gold NFT for the following reasons \u2013</p><p>o Since NexuiCom has joined the DBC Ecosystem we have taken personal time to support DBC in a number of ways</p><p>o Through Social Media, Twitter is big here in the United States and I believe it is important for as many people to hear about our project, how it works, what we provide and what others can do to help grow the ecosystem, therefore we are reviewing posts daily and adding new information or progress as it happens. We also interact with as many people as possible to provide a positive outlook on the DBC Project</p><p>o We have been present at all Council meetings which have been made public, I listen and provide feedback where necessary</p><p>o I thoroughly enjoyed being part of the AMA sessions, not only answering questions provided but also listening to others and their ideas/opinions</p><p>o NexuiCom became the first GPU Server to be set up here in North America without any financial support, but of course with the support of the DBC Team. To be the first was more of a privilege than anything else, our goal is to help grow the ecosystem however we can o NexuiCom has also worked hard at setting up the first GPU Cloud Platform here in North America, there is still a lot more work to be completed and goals to be met but we are on track and we are determined to bring awareness to our project however we can</p><p>Here at NexuiCom we are determined to bring as much attention to the DBC project as possible, we are devoted to making sure not only we succeed but the Deep Brain Chain project, community and ecosystem also succeeds</p><p>If we are to be issued with the Gold/Silver NFT it will more than likely be reinvested back into the project to ensure success, we must first plant the seed, then water it, invest in it and only after a time can we pick the fruit and share with others what we have created.</p><p>NexuiCom Bringing the World of Tomorrow to the People of Today</p><h2 id="\u4E2D\u6587" tabindex="-1"><a class="header-anchor" href="#\u4E2D\u6587" aria-hidden="true">#</a> \u4E2D\u6587</h2><p>NexuiCom \u51FA\u65BC\u4EE5\u4E0B\u539F\u56E0\u63D0\u51FA\u6279\u51C6\u91D1/\u9280 NFT\uFF1A</p><p>o \u81EA\u5F9E NexuiCom \u52A0\u5165 DBC \u751F\u614B\u7CFB\u7D71\u4EE5\u4F86\uFF0C\u6211\u5011\u82B1\u6642\u9593\u4EE5\u591A\u7A2E\u65B9\u5F0F\u652F\u6301 DBC</p><p>o \u901A\u904E\u793E\u4EA4\u5A92\u9AD4\uFF0CTwitter \u5728\u7F8E\u570B\u5F88\u91CD\u8981\uFF0C\u6211\u76F8\u4FE1\u8B93\u76E1\u53EF\u80FD\u591A\u7684\u4EBA\u4E86\u89E3\u6211\u5011\u7684\u9805\u76EE\u3001\u5B83\u662F\u5982\u4F55\u904B\u4F5C\u7684\u3001\u6211\u5011\u63D0\u4F9B\u4EC0\u9EBC\u4EE5\u53CA\u5176\u4ED6\u4EBA\u53EF\u4EE5\u505A\u4E9B\u4EC0\u9EBC\u4F86\u5E6B\u52A9\u767C\u5C55\u751F\u614B\u7CFB\u7D71\u662F\u5F88\u91CD\u8981\u7684\uFF0C\u56E0\u6B64\u6211\u5011\u662F\u6BCF\u5929\u5BE9\u67E5\u5E16\u5B50\u4E26\u5728\u767C\u751F\u6642\u6DFB\u52A0\u65B0\u4FE1\u606F\u6216\u9032\u5C55\u3002\u6211\u5011\u9084\u8207\u76E1\u53EF\u80FD\u591A\u7684\u4EBA\u4E92\u52D5\uFF0C\u70BA DBC \u9805\u76EE\u63D0\u4F9B\u7A4D\u6975\u7684\u524D\u666F</p><p>o \u6211\u5011\u51FA\u5E2D\u4E86\u6240\u6709\u516C\u958B\u7684\u7406\u4E8B\u6703\u6703\u8B70\uFF0C\u6211\u50BE\u807D\u4E26\u5728\u5FC5\u8981\u6642\u63D0\u4F9B\u53CD\u994B</p><p>o \u6211\u975E\u5E38\u559C\u6B61\u53C3\u52A0 AMA \u6703\u8B70\uFF0C\u4E0D\u50C5\u56DE\u7B54\u63D0\u4F9B\u7684\u554F\u984C\uFF0C\u9084\u50BE\u807D\u4ED6\u4EBA\u53CA\u5176\u60F3\u6CD5/\u610F\u898B</p><p>o NexuiCom \u6210\u70BA\u5728\u5317\u7F8E\u8A2D\u7ACB\u7684\u7B2C\u4E00\u500B GPU \u670D\u52D9\u5668\uFF0C\u6C92\u6709\u4EFB\u4F55\u8CA1\u52D9\u652F\u6301\uFF0C\u4F46\u7576\u7136\u5F97\u5230\u4E86 DBC \u5718\u968A\u7684\u652F\u6301\u3002\u6210\u70BA\u7B2C\u4E00\u500B\u6BD4\u4EC0\u9EBC\u90FD\u91CD\u8981\uFF0C\u6211\u5011\u7684\u76EE\u6A19\u662F\u5E6B\u52A9\u751F\u614B\u7CFB\u7D71\u767C\u5C55\uFF0C\u4F46\u6211\u5011\u53EF\u4EE5 o NexuiCom \u4E5F\u52AA\u529B\u5728\u5317\u7F8E\u5EFA\u7ACB\u7B2C\u4E00\u500B GPU \u96F2\u5E73\u53F0\uFF0C\u9084\u6709\u5F88\u591A\u5DE5\u4F5C\u8981\u505A\u6709\u5F85\u5B8C\u6210\u548C\u8981\u5BE6\u73FE\u7684\u76EE\u6A19\uFF0C\u4F46\u6211\u5011\u6B63\u5728\u8D70\u4E0A\u6B63\u8ECC\uFF0C\u6211\u5011\u6C7A\u5FC3\u76E1\u6211\u5011\u6240\u80FD\u70BA\u6211\u5011\u7684\u9805\u76EE\u5E36\u4F86\u610F\u8B58</p><p>\u5728 NexuiCom\uFF0C\u6211\u5011\u6C7A\u5FC3\u76E1\u53EF\u80FD\u591A\u5730\u95DC\u6CE8 DBC \u9805\u76EE\uFF0C\u6211\u5011\u81F4\u529B\u65BC\u78BA\u4FDD\u4E0D\u50C5\u6211\u5011\u6210\u529F\uFF0C\u800C\u4E14\u6DF1\u8166\u93C8\u9805\u76EE\u3001\u793E\u5340\u548C\u751F\u614B\u7CFB\u7D71\u4E5F\u6210\u529F</p><p>\u5982\u679C\u6211\u5011\u8981\u767C\u884C\u9EC3\u91D1/\u767D\u9280 NFT\uFF0C\u5B83\u5F88\u53EF\u80FD\u6703\u88AB\u91CD\u65B0\u6295\u8CC7\u56DE\u9805\u76EE\u4EE5\u78BA\u4FDD\u6210\u529F\uFF0C\u6211\u5011\u5FC5\u9808\u5148\u64AD\u7A2E\uFF0C\u7136\u5F8C\u6F86\u6C34\uFF0C\u6295\u8CC7\u5B83\uFF0C\u53EA\u6709\u5728\u4E00\u6BB5\u6642\u9593\u4E4B\u5F8C\uFF0C\u6211\u5011\u624D\u80FD\u6311\u9078\u7D50\u51FA\u679C\u5BE6\u4E26\u8207\u4ED6\u4EBA\u5206\u4EAB\u6211\u5011\u5275\u9020\u7684\u6771\u897F\u3002</p><p>NexuiCom \u70BA\u4ECA\u5929\u7684\u4EBA\u5011\u5E36\u4F86\u660E\u5929\u7684\u4E16\u754C</p>',25),n=[s];function p(h,l){return o(),t("div",null,n)}var m=e(r,[["render",p],["__file","27.html.vue"]]);export{m as default};
